import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';

function SignIn() {


  return (
    <div>
      <form onSubmit={handleLogin}>
        <label>
          Password:
          <input
            type="password"
            value={password}
            onChange={handlePasswordChange}
          />
        </label>
        <button type="submit">Login</button>
      </form>
    </div>
  );
}

export default SignIn;
